import React, { Component } from 'react';
import { Nav } from 'react-bootstrap';
import '../Styles/Universities.css';
import Navigation from '../Components/Navigation';
import Footer from '../Components/Footer';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import UT from '../static_resources/ut_austin.png';
import UCB from '../static_resources/uc_berkeley.png';
import UW from '../static_resources/uw_seattle.png';

class Universities extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <Jumbotron className="universities-jumbotron"></Jumbotron>
        <p>
          Find the University that's the best fit for you. <br />
          Explore information on over 5,000 Universities across the country.
        </p>

        <Container>
          <Row>
            <Col md={4}>
              <Card className="universities-card">
                <Nav.Link href="/universities/ut_austin">
                  <Card.Img src={UT} variant="top" height="200" />
                  <Card.Body>
                    <Card.Title>University of Texas - Austin</Card.Title>
                    <Card.Text>Score: 100.00</Card.Text>
                  </Card.Body>
                </Nav.Link>
              </Card>
            </Col>
            <Col md={4}>
              <Card className="universities-card">
                <Nav.Link href="/universities/uc_berkeley">
                  <Card.Img src={UCB} variant="top" height="200" />
                  <Card.Body>
                    <Card.Title>University of California - Berkeley</Card.Title>
                    <Card.Text>Score: 93.75</Card.Text>
                  </Card.Body>
                </Nav.Link>
              </Card>
            </Col>
            <Col md={4}>
              <Card className="universities-card">
                <Nav.Link href="/universities/uw_seattle">
                  <Card.Img src={UW} variant="top" height="200" />
                  <Card.Body>
                    <Card.Title>University of Washington - Seattle</Card.Title>
                    <Card.Text>Score: 88.50</Card.Text>
                  </Card.Body>
                </Nav.Link>
              </Card>
            </Col>
          </Row>
        </Container>
        <p></p>
        <Footer />
      </div>
    );
  }
}

export default Universities;
